import styled from "styled-components";

const Header__upper = styled.div`
  display: flex;
  justify-content: space-between;
`;

const MainLogo = styled.img`
  width: 20px;
  height: 20px;
`;
const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
`;

function Header() {
  return (
    <Header__upper>
      <MainLogo src="../img/new_logo_nobackground.png" alt="Main Logo" />
      <Menus>
        <Menu>클럽 소개</Menu>
      </Menus>
    </Header__upper>
  );
}

export default Header;
